import React from 'react';

class Formulario extends React.Component {

    render() {
        return (
            <form>
                <label>
                    Nombre:
                <input type="text" name="txtNombre" />
                </label>
                <input type="submit" value="Enviar" />
            </form>

        );
    }
}
export default Formulario;
